import React from "react";
import "./welcome.css"

const Welcome = () => {
    return (
        <div className="welcome">
            <h1>Bienvenu!</h1>
            <p>Merci de votre inscription. Nous sommes ravis de vous compter à bord !</p>
        </div>
    );
}

export default Welcome;
